import React, { useState } from "react";

const SearchBar=()=>{

    const [text , setText] = useState('')

    return (
        <div>
            <form>
                <label>Search</label>
                <input type="text" onChange={(e)=>setText(e.target.value)}/>
            </form>
            {text}
        </div>
    );
}
export default SearchBar;
